import React from "react";

const Searcbar = () => {
    let search = "Pikachu";
    return (
        <div>
            <div>
                <input placeholder="Buscar Pokemon..."/>
            </div>
            <div>
                {search}
            </div>
        </div>
    )
} 

export default Searcbar;
